import React from 'react';
import '../styles/education.css'

const Education = () => {

    function Card({ title, year, institute, location, description }) {
        return (
          <div className="card">
            <div className="title">{title}</div>
            <div className="year">{year}</div>
            <div className="institute">{institute}</div>
            <div className="location">{location}</div>
            <div className="description">{description}</div>
          </div>
        );
      }
    return (
      
        <div className="app">
        <Card
          title="Engineering"
          year="2020-2024"
          institute="Sethu Institute of Technology"
          location="Madurai, TamilNadu"
          description="Bachelor of Engineering (Computer Science and Engineering) with aggregate of 76.6%(CGPA)"
        />
        <Card
          title="Engineering"
          year="2020-2024"
          institute="Sethu Institute of Technology"
          location="Madurai, TamilNadu"
          description="Bachelor of Engineering (Computer Science and Engineering) with aggregate of 76.6%(CGPA)"
        />
      </div>
    );
  }

      
       


export default Education
